Block.P:
%if entity.remainingTime isn't 0, the task has been preempted.
%Thus, continue with the remaining time
%Otherwise, just use the segement executiontime.
if(entity.remainingTime ~= 0)
    dt = entity.remainingTime;
else
    dt = entity.executionTime(entity.segment);
end

% A non preemptable task will shut the gate, this prevents preemtion.
% the last segment of a task is the time required to terminate this task
% and start the next task. This is normally handled by the scheduler, 
% thus the last segment should run uninterrupted.
if(entity.preemptable == false | entity.numSegments == entity.segment)
    if(entity.type == 1)
        controlGate(0);
    end
    if(entity.type == 2)
        %Type 2 = ISR, ISR2 have slight transition period between them, in order of µs.
        %On transition we can't interrupt the ISR.
        setGlobalInterrupts(0);
    end
end

%For the last bit, we assume the entity to be non preemptable as its
%Actually the scheduler that runs here.
if(entity.numSegments == entity.segment)
    entity.preemptableSwitch = 1;
    entity.preemptable = 0;
end

%------------------------------------------
% get inputs on first segment
% This is not neccesarry, but usually this is how
% You'd work when running matlab code on an embedded processor.
%------------------------------------------
switch entity.ID
    case 1 %Task with ID 1
        switch entity.segment
            case 1
                PowerWindow_Inputs();
        end
    case 2 %Task with ID 1
        switch entity.segment
            case 1
                %Do nothing
        end
    case 3 %Task with ID 3
        switch entity.segment
            case 1
                Debounce_Inputs();
        end
    case 4 %Task with ID 4
        switch entity.segment
            case 1
                Debounce_Inputs();
        end
end

%Change state to running
%Not really used anywhere, but can possibly be useful
entity.state = 2;

% Resource management
% Calls resourceCtrl, which implements a very basic version of OSEK priority ceiling (with 1 resource)
% More resources can easily be added to the function
if(entity.requiresResource(entity.segment))
    entity.priorityNr = resourceCtrl(entity.requiresResource(entity.segment), entity.ID, entity.priorityNr, 1);
    if(entity.type == 1)
        entity.prioritySwitch = entity.priorityNr;
    else
        entity.prioritySwitch = entity.priorityNr;
    end
end

% Switch input switch to port 1
% The controlSwitch switches between a looping task that went from seg => seg+1
% Setting it back to one allowes preemption from higher priority tasks, granted the gate is also open.
controlSwitch(1);

%Loggin
if(enableLogging == 1)
    drawTaskTiming(entity.ID, 1);
end
if(logResourceUsage == 1)
    drawResourceUsage(entity.requiresResource(entity.segment), 1);
end

%If needed, code that executes upon task preemption can be placed here.
%Logging
if(enableLogging == 1)
    drawTaskTiming(entity.ID, 2);
end

if(logResourceUsage == 1)
    drawResourceUsage(entity.requiresResource(entity.segment), 3);
end

