eml.P:
function updatedPriority = fcn(resource, taskID, currentPriority, get, resourcePriorities)
%{
OSEK Priority Ceiling is in essence a more advanced form of mutexes.
Each resource can be acquired once, and once acquired, any other tasks
requiring this resource cannot interrupt the currently running task.
How it works:
Everything is array based, the indexes determine the resource number, index
1 is resource1 and so forth.
- resourcePriority stores the priorities of the resources.
- originalPriority stores the original priorities of tasks acquiring a
resource. Thus once they release the resource they get their priority back.
- currentHolder stores the current holder of a priority, or -1 if no holder

Parameters:
resource: The ID of the requested resource
taskID: The ID of the requesting task
currentPriority: The currentPriority of the task
get: signifies get (1) or release (0)
resourcePriorities: list of all resource prioritylevels.
%}
persistent currentHolder originalPriority;
if isempty(currentHolder)
    currentHolder = -1*ones(length(resourcePriorities));
    originalPriority = -1*ones(length(resourcePriorities));
    %Set the PriorityResource here according to OSEK Priority Ceiling
end

if(get)
    %in case of get, if currentHolder == -1, update currentHolder to
    %taskID, return the new priority and reduce resource1count
    if(currentHolder == -1)
        currentHolder(resource) = taskID;
        originalPriority(resource) = currentPriority;
        updatedPriority = resourcePriorities(resource);
    elseif(currentHolder == taskID)
        %In this case, the task has acquired the resource, but has been
        %preempted. Upon reentry in the task processor it tries to get a
        %resource again, as the task does not keep track of whether or not
        %it has a resource
        %Just return the priority of the requested resource.
        updatedPriority = resourcePriorities(resource);
    else
        %In case a wrong function call is made, return the currentPriority
        %so nothing gets changed.
        updatedPriority = currentPriority;
    end
else
    %in case of release, if taskID == currentHolder, release (should be the
    %only possibility
    if(currentHolder(resource) == taskID)
        currentHolder(resource) = -1;
        updatedPriority = originalPriority(resource);
    else
        %Otherwise, in case of wrong function call, return currentPriority
        updatedPriority = currentPriority;
    end 
end

function occured = fcn(event, taskID, get, compareTime, currentTime)
%event and taskID are optional for further expansion of functionality
persistent lastEventTime;
if isempty(lastEventTime)
    lastEventTime = 0;
end

if(get)
    %in case of get, we compare the compareTime with the lastEventTime
    %if lastEventTime is larget than compareTime, return 1 otherwise 0
    if(lastEventTime > compareTime)
        occured = 1;
    else
        occured = 0;
    end
else
    %in case we set the event, we just store the currentTime in the
    %lastEventTime
    lastEventTime = currentTime;
    occured = 1;
end
